import React from 'react'
import Photo16 from '../assets/photo16.png';
function Industries() {
  return (
    <div className='md:px-12 p-4 max-w-screen-2xl mx-auto mt-16' id="Industries">
    <div className=' gradiantbg rounded-xl rounded-br-[80px] flex flex-col md:flex-row-reverse justify-between items-center gap-10 px-5'>
    <div><img src={Photo16}/></div>
    
    
    </div>
    </div>
  )
}

export default Industries
